'{UXPRERENDEREDALIAS}_DlgObj.phoneGapGetLocalDirURL = function(type) {',
'   var dir = "";',
'   if (!{UXPRERENDEREDALIAS}_DlgObj.phoneGapFilesAvailable()) return dir;',
