'         case "private":',
'            dir = cordova.file.dataDirectory;',
'            break;',
'         case "saved":',
'            dir = cordova.file.syncedDataDirectory;',
'            break;',
'         case "public":',
'            dir = cordova.file.documentsDirectory;',
'            break;',
